import { Component } from "react";
import { Link } from "react-router-dom";
import { NavList } from "./NavList";
import {Ug} from './images/PG.jpg'
import './images/NavbarCoureses.css'
import Logo from './images/logo2.jpeg';


class NavbarCoureses extends Component{
    render(){
        return(
            <>
            <nav className="">
                <div className="main-img-contant" ></div>
                <img src={Logo} width={500} style={{display: 'flex', justifyContent: 'center', alignItems: 'center'}} alt="" />
                <h3></h3>

                {/* menu icons */}
                <div className="menu-icons">
                    <i className=''></i>
                </div>

                {/* nav-links for ug pg mba ca */}
                <div className="">
                <div className="nav-cords">
                    {NavList.map((item,index) => {
                        return(
                            <div key={index}  className="main-card card" >

                                <img src={item.src} width={400} alt=""/>
                                <div className="intro1">
                                <h2 className=""> {item.title}</h2>
                                <ul className="links">
                                    <li><Link className="links ">{item.title1}</Link></li>
                                    <li><Link className="links ">{item.title2}</Link></li>
                                    <li><Link className="links ">{item.title3}</Link></li>                  
                                    <li><Link className="links ">{item.title4}</Link></li>


                                </ul>
                                </div>
                            </div>

                        )
                    })}
                  </div>
                </div>
            </nav>

            </>
        )
    }
}

export default NavbarCoureses;
